ng of the variables and their formats, the next step is to check for the number of missing values in each column and their respective sizes.\n","  \n","Since R treats missing values in columns with string format as the word \"NULL\", applying the colSums(is.na()) function does not work as it requires numeric formats. The direct replacement of \"NULL\" using df[df = \"NULL\"] <- NA also does not work since there is a column with date as the format interfering with it. To overcome this, the date column is temporarily converted into string to allow the replacement function to work.\n","\n","Also, there is an issue in the country where CN (China) isn't in ISO3 format (CHN), we'll also take this opportunity to change this and add their full names for ease of visualization later down the track."]},{"cell_type":"markdown","id":"f0e696ff","metadata":{"papermill":{"duration":0.192759,"end_time":"2022-03-26T00:59:55.400016","exception":false,"start_time":"2022-03-26T00:59:55.207257","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"1ec1118f","metadata":{"papermill":{"duration":0.180575,"end_time":"2022-03-26T00:59:55.761587","exception":false,"start_time":"2022-03-26T00:59:55.581012","status":"completed"},"tags":[]},"source":["<a id=\"section-2.2\"></a>\n","### 2.2 Data Cleansing ###\n","In this section, the task is to convery all \"NULL\" to NA and CN to CHN"]},{"cell_type":"code","execution_count":4,"id":"6cbb9966","metadata":{"execution":{"iopub.execute_input":"2022-03-26T00:59:56.130507Z","iopub.status.busy":"2022-03-26T00:59:56.128326Z","iopub.status.idle":"2022-03-26T01:00:03.238403Z","shell.execute_reply":"2022-03-26T01:00:03.236509Z"},"papermill":{"duration":7.296337,"end_time":"2022-03-26T01:00:03.238558","exception":false,"start_time":"2022-03-26T00:59:55.942221","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message in countrycode(dftemp1$country, \"iso3c\", \"country.name\"):\n","“Some values were not matched unambiguously: TMP\n","”\n","Warning message in countrycode(dftemp1$country, \"iso3c\", \"continent\"):\n","“Some values were not matched unambiguously: ATA, ATF, TMP, UMI\n","”\n","Warning message in countrycode(dftemp1$country, \"iso3c\", \"region23\"):\n","“Some values were not matched unambiguously: ATA, ATF, TMP, UMI\n","”\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A matrix: 1 × 7 of type dbl</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>children</th><th scope=col>country</th><th scope=col>agent</th><th scope=col>company</th><th scope=col>country_name</th><th scope=col>continent</th><th scope=col>region</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>.</th><td>4</td><td>488</td><td>16340</td><td>112593</td><td>491</td><td>495</td><td>495</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A matrix: 1 × 7 of type dbl\n","\\begin{tabular}{r|lllllll}\n","  & children & country & agent & company & country\\_name & continent & region\\\\\n","\\hline\n","\t. & 4 & 488 & 16340 & 112593 & 491 & 495 & 495\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A matrix: 1 × 7 of type dbl\n","\n","| <!--/--> | children | country | agent | company | country_name | continent | region |\n","|---|---|---|---|---|---|---|---|\n","| . | 4 | 488 | 16340 | 112593 | 491 | 495 | 495 |\n","\n"],"text/plain":["  children country agent company country_name continent region\n",". 4        488     16340 112593  491          495       495   "]},"metadata":{},"output_type":"display_data"}],"source":["# 1. Converting date column to string temporarily to allow replacement of \"NULL\" to NA to work\n","dftemp1 <- transform(df, reservation_status_date = as.character(reservation_status_date))\n","\n","# 2. Replacing \"NULL\" with NA to prep data for colSums to work\n","dftemp1[dftemp1 == \"NULL\"] <- NA\n","dftemp1[dftemp1 == \"CN\"] <- \"CHN\"\n","\n","# 3. Adding country names, continents and regions in addition to iso3c codes (comes in handy when visualizing)\n","dftemp1$country_name <- countrycode(dftemp1$country, \"iso3c\", \"country.name\")\n","dftemp1$continent <- countrycode(dftemp1$country, \"iso3c\", \"continent\")\n","dftemp1$region <- countrycode(dftemp1$country, \"iso3c\", \"region23\")\n","\n","# 4. Converting date column back to date\n","dftemp2 <- transform(dftemp1, reservation_status_date = as.Date(reservation_status_date))\n","\n","# 5. Summarise columns with NA values\n","colSums(is.na(dftemp2)) %>%\n","data.frame() %>%\n","filter(. !=0) %>%\n","t()"]},{"cell_type":"markdown","id":"0a54c55b","metadata":{"papermill":{"duration":0.183464,"end_time":"2022-03-26T01:00:03.606222","exception":false,"start_time":"2022-03-26T01:00:03.422758","status":"completed"},"tags":[]},"source":["Since there's a significant portion of the observation in company being NA (112,593 vs 119,390), dropping rows with NAs is not feasible. Also, it looks like territories don't have a mapping under the countrycode package. They come up to ~0.4% of the data set, which I think is small enough to be categorised as None.\n","\n","In the next section, the variables (country, country_name, continent, agent and company) with NAs is replaced with None and children will be replace with 0."]},{"cell_type":"markdown","id":"337a970b","metadata":{"papermill":{"duration":0.186644,"end_time":"2022-03-26T01:00:03.978455","exception":false,"start_time":"2022-03-26T01:00:03.791811","status":"completed"},"tags":[]},"source":["<a id=\"section-2.3\"></a>\n","### 2.3 NA Values Replacements ###"]},{"cell_type":"code","execution_count":5,"id":"ec3e77f9","metadata":{"execution":{"iopub.execute_input":"2022-03-26T01:00:04.358873Z","iopub.status.busy":"2022-03-26T01:00:04.356611Z","iopub.status.idle":"2022-03-26T01:00:04.981886Z","shell.execute_reply":"2022-03-26T01:00:04.97989Z"},"papermill":{"duration":0.815239,"end_time":"2022-03-26T01:00:04.982037","exception":false,"start_time":"2022-03-26T01:00:04.166798","status":"completed"},"tags":[]},"outputs":[],"source":["# 1. Replacing all NAs with 0\n","dftemp2[is.na(dftemp2)] <- 0\n","\n","# 2. Replacing 0s in country, agent and company with \"None\" and preview\n","dftemp3 <- mutate(dftemp2,\n","                    country = replace(country, country == 0, \"None\"),\n","                    agent = replace(agent, agent == 0, \"None\"),\n","                    company = replace(company, company == 0, \"None\"),\n","                    country_name = replace(country_name, country_name == 0, \"None\")\n","                    )"]},{"cell_type":"markdown","id":"82e3fa51","metadata":{"papermill":{"duration":0.186087,"end_time":"2022-03-26T01:00:05.355044","exception":false,"start_time":"2022-03-26T01:00:05.168957","status":"completed"},"tags":[]},"source":["<a id=\"section-2.4\"></a>\n","### 2.4 Data Synthesis ###"]},{"cell_type":"code","execution_count":6,"id":"d9cfa624","metadata":{"execution":{"iopub.execute_input":"2022-03-26T01:00:05.732185Z","iopub.status.busy":"2022-03-26T01:00:05.730542Z","iopub.status.idle":"2022-03-26T01:00:06.223395Z","shell.execute_reply":"2022-03-26T01:00:06.220895Z"},"papermill":{"duration":0.684096,"end_time":"2022-03-26T01:00:06.223593","exception":false,"start_time":"2022-03-26T01:00:05.539497","status":"completed"},"tags":[]},"outputs":[],"source":["# 1. Adding four new columns, total nights, total rate, total guests and total of the three\n","dftemp3 <- mutate(dftemp2,\n","                    total_nights = (stays_in_weekend_nights + stays_in_week_nights),\n","                    total_rate = (total_nights * adr),\n","                    total_guests = (adults + children + babies),\n","                    total_nights_rate_guests = (total_nights + total_rate + total_guests)\n","                    )\n","\n","#2. Adding arrival month_year column to allow for easier visualization later\n","dftemp4 <- transform(dftemp3, arrival_date_year = as.character(arrival_date_year)) %>%\n","        mutate(month_year