  mutate(\"average_rate\" = total_rate / bookings_count) %>%\n","    filter(continent != 0)\n","\n","#3. Summarizing data by continent\n","dfcchartscontonly <- dfc %>%\n","    group_by(continent) %>%\n","    summarize(\"total_rate\" = sum(total_rate), \"bookings_count\" = n()) %>%\n","    mutate(\"average_rate\" = total_rate / bookings_count) %>%\n","    filter(continent != 0)\n","\n","#4. Setting an overarching theme for the bar charts\n","Theme1 <- theme(legend.position = \"top\",\n","                    legend.title = element_blank(),\n","                    plot.title = element_text(size = 24),\n","                    axis.title = element_blank(),\n","                    axis.text.x = element_text(size = 20),\n","                    axis.text.y = element_text(size = 15),\n","                    legend.text = element_text(size = 15),\n","                    legend.spacing.x = unit(4, 'mm'),\n","                    legend.justification = 'left')\n","\n","#5. Plots\n","Plot1a <- ggplot(dfccharts, aes(x = reorder(continent, -bookings_count), y = bookings_count)) +\n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(suffix = \"K\", scale = 0.001)) +\n","            labs(title = \"Total Number of Bookings by Continent\") +\n","            Theme1\n","\n","Plot2a <- ggplot(dfccharts, aes(x = reorder(continent, -bookings_count), y = bookings_count, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(suffix = \"K\", scale = 0.001)) +\n","            labs(title = \"Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","Plot3a <- ggplot(dfcchartscontonly, aes(x = reorder(continent, -average_rate), y = average_rate)) +\n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Continent\") +\n","            Theme1\n","\n","Plot4a <- ggplot(dfccharts, aes(x = reorder(continent, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#6. Arraging and aligning each plot\n","grid.arrange(Plot1a, Plot3a, ncol = 2)\n","grid.arrange(Plot2a, Plot4a, ncol = 2)"]},{"cell_type":"markdown","id":"b2fa14e4","metadata":{"papermill":{"duration":0.202937,"end_time":"2022-03-26T01:00:17.777043","exception":false,"start_time":"2022-03-26T01:00:17.574106","status":"completed"},"tags":[]},"source":["It appears Europe is by far the most popular destination along with a strong preference for city hotels vs resorts. However, Africa is the most expensive continent to visit where averag rates are over $600 per night's stay.  \n","  \n","Also, resort average rates are typically higher except in Africa. The Americas seems to have similar average rates between city and resort hotels. The below drills down into the respective regions to get an idea what the cost breakdowns are like."]},{"cell_type":"markdown","id":"5594f5f2","metadata":{"papermill":{"duration":0.201972,"end_time":"2022-03-26T01:00:18.181114","exception":false,"start_time":"2022-03-26T01:00:17.979142","status":"completed"},"tags":[]},"source":["<a id=\"section-4.1\"></a>\n","### 4.1 Booking Volume and Average Nightly Cost in Europe ###"]},{"cell_type":"code","execution_count":12,"id":"8b86a40d","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:00:18.588688Z","iopub.status.busy":"2022-03-26T01:00:1