GQAAAAAAAAAAIkGhDAAAAAAAAAAAkZCV6g4AEZKZ0/Oggw4KIbTu\n0jXVfQEajdCG6BDvkGYENUBLIWMD8gBEhGAH5IFNI5ZIJFLdBwAAAAAAAAAAaHJuvQQAAAAA\nAAAAQCQolAEAAAAAAAAAIBIUygAAAAAAAAAAEAkKZQAAAAAAAAAAiASFMgAAAAAAAAAARIJC\nGQAAAAAAAAAAIkGhDAAAAAAAAAAAkaBQBgAAAAAAAACASFAoAwAAAAAAAABAJPw/QfMq1FmR\nVK0AAAAASUVORK5CYII="},"metadata":{"image/png":{"height":300,"width":1500}},"output_type":"display_data"}],"source":["#1. Summarizing data by hotel and region\n","dfchotelregions <- dfc %>%\n","    filter(continent == \"Europe\") %>%\n","    group_by(hotel, region) %>%\n","    summarize(\"total_rate\" = sum(total_rate), \"bookings_count\" = n()) %>%\n","    mutate(\"average_rate\" = total_rate / bookings_count)\n","\n","#3. Summarizing data by region\n","dfcregionsonly <- dfc %>%\n","    filter(continent == \"Europe\") %>%\n","    group_by(region) %>%\n","    summarize(\"total_rate\" = sum(total_rate), \"bookings_count\" = n()) %>%\n","    mutate(\"average_rate\" = total_rate / bookings_count)\n","\n","#4. Plots\n","Plot1b <- ggplot(dfcregionsonly, aes(x = reorder(region, -bookings_count), y = bookings_count)) + \n","            geom_col(fill = \"steelblue\") +\n","            labs(title = \"Number of Bookings by Region in Europe\") +\n","            Theme1\n","\n","Plot2b <- ggplot(dfchotelregions, aes(x = reorder(region, -bookings_count), y = bookings_count, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","Plot3b <- ggplot(dfcregionsonly, aes(x = reorder(region, -average_rate), y = average_rate)) + \n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Region in Europe\") +\n","            Theme1\n","\n","Plot4b <- ggplot(dfchotelregions, aes(x = reorder(region, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#5. Arraging and aligning each plot\n","grid.arrange(Plot1b, Plot3b, ncol = 2)\n","grid.arrange(Plot2b, Plot4b, ncol = 2)"]},{"cell_type":"markdown","id":"c5e44d64","metadata":{"papermill":{"duration":0.210092,"end_time":"2022-03-26T01:00:20.184612","exception":false,"start_time":"2022-03-26T01:00:19.97452","status":"completed"},"tags":[]},"source":["<a id=\"section-4.2\"></a>\n","### 4.2 Booking Volume and Average Nightly Cost in Americas ###"]},{"cell_type":"code","execution_count":13,"id":"009553a5","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:00:20.604648Z","iopub.status.busy":"2022-03-26T01:00:20.602702Z","iopub.status.idle":"2022-03-26T01:00:21.616278Z","shell.execute_reply":"2022-03-26T01:00:21.61453Z"},"papermill":{"duration":1.224851,"end_time":"2022-03-26T01:00:21.61649","exception":false,"start_time":"2022-03-26T01:00:20.391639","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAAJYCAIAAAB9qzx/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2ATZR/A8Sej6V5QWvaeZYgMRQVE4GU6EBBFwIGoIDhAREUQRZApICiCA8UN\nCogKylK2MmTvIWXLhu6V3PtH0mtIk2uaXEab7+eva+65y3P7eX795TmNJEkCAAAAAAAAAAAA\nAAAAKOm0vq4AAAAAAAAAAAAAAAAA4A0kygAAAAAAAAAAAAAAACAgkCgDAAAAAAAAAAAAAACA\ngECiDAAAAAAAAAAAAAAAAAICiTIAAAAAAAAAAAAAAAAICCTKAAAAAAAAAAAAAAAAICCQKAMA\nAAAAAAAAAAAAAICAQKIMAAAAAAAAAAAAAAAAAkJAJMrUCA3S5Gk7ZYfzCyYtbScvuPhKhudq\n6FH9EiLMm5A46C9f18UfXd3z6+BeHauXLR2sD4qIKfvYzyedX/bpcpGawuiDw+ISyte/re2A\nl0Yv/+eM5zZERb/emmCufOk