ionsonly, aes(x = reorder(region, -average_rate), y = average_rate)) + \n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Region in the Americas\") +\n","            Theme1\n","\n","Plot4c <- ggplot(dfchotelregions, aes(x = reorder(region, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#5. Arraging and aligning each plot\n","grid.arrange(Plot1c, Plot3c, ncol = 2)\n","grid.arrange(Plot2c, Plot4c, ncol = 2)"]},{"cell_type":"markdown","id":"b352bf40","metadata":{"papermill":{"duration":0.216721,"end_time":"2022-03-26T01:00:22.048031","exception":false,"start_time":"2022-03-26T01:00:21.83131","status":"completed"},"tags":[]},"source":["<a id=\"section-4.3\"></a>\n","### 4.3 Booking Volume and Average Nightly Cost in Asia ###"]},{"cell_type":"code","execution_count":14,"id":"bdbadb70","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:00:22.510792Z","iopub.status.busy":"2022-03-26T01:00:22.508692Z","iopub.status.idle":"2022-03-26T01:00:23.583703Z","shell.execute_reply":"2022-03-26T01:00:23.582412Z"},"papermill":{"duration":1.321476,"end_time":"2022-03-26T01:00:23.583846","exception":false,"start_time":"2022-03-26T01:00:22.26237","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAAJYCAIAAAB9qzx/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5wTRRvA8Um5XO8HR+/1BESKFRCBl2pBQBQBKxakKIioCKIIIh1BEAsodlRA\nVFCKShGUIl16r1IPrl8uyb5/JLcXckkul2wa+X3/8LNkZ3dny+RmHp/MqiRJEgAAAAAAAAAA\nAAA