tel\" = \"steelblue4\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","Plot3d <- ggplot(dfcregionsonly, aes(x = reorder(region, -average_rate), y = average_rate)) + \n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Region in Asia\") +\n","            Theme1\n","\n","Plot4d <- ggplot(dfchotelregions, aes(x = reorder(region, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#5. Arraging and aligning each plot\n","grid.arrange(Plot1d, Plot3d, ncol = 2)\n","grid.arrange(Plot2d, Plot4d, ncol = 2)"]},{"cell_type":"markdown","id":"537c64f7","metadata":{"papermill":{"duration":0.221431,"end_time":"2022-03-26T01:00:24.026838","exception":false,"start_time":"2022-03-26T01:00:23.805407","status":"completed"},"tags":[]},"source":["<a id=\"section-4.4\"></a>\n","### 4.4 Booking Volume and Average Nightly Cost in Africa ###"]},{"cell_type":"code","execution_count":15,"id":"17903cee","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:00:24.478196Z","iopub.status.busy":"2022-03-26T01:00:24.474785Z","iopub.status.idle":"2022-03-26T01:00:25.532907Z","shell.execute_reply":"2022-03-26T01:00:25.532075Z"},"papermill":{"duration":1.283646,"end_time":"2022-03-26T01:00:25.533052","exception":false,"start_time":"2022-03-26T01:00:24.249406","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAAJYCAIAAAB9qzx/AAAABmJLR0QA/wD/AP+gvaeTA