7/t7Yy6PNIEA0338ywP\n5LmUVs8lQ53nmHydF/nS30x+f84BSTkvktK/DGx+LDIy9DNiWKbrOgQqdQLVJep6FxMAAAAM\nZa0tjQ0Nh/MmFhfk9vpLXAAAAAD6nWEZLiQKZQAAAAAAAAAASAsZg/0BAAAAAAAAAADgXFAo\nAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAA\nAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAo\nAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAAAABAWlAoAwAAAAAA\nAABAWvgPE2yAByYGvDQAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":300,"width":1500}},"output_type":"display_data"}],"source":["#1. Summarizing data by hotel and region\n","dfchotelregions <- dfc %>%\n","    filter(continent == \"Africa\") %>%\n","    group_by(hotel, region) %>%\n","    summarize(\"total_rate\" = sum(total_rate), \"bookings_count\" = n()) %>%\n","    mutate(\"average_rate\" = total_rate / bookings_count)\n","\n","#3. Summarizing data by region\n","dfcregionsonly <- dfc %>%\n","    filter(continent == \"Africa\") %>%\n","    group_by(region) %>%\n","    summarize(\"total_rate\" = sum(total_rate), \"bookings_count\" = n()) %>%\n","    mutate(\"average_rate\" = total_rate / bookings_count)\n","\n","#4. Plots\n","Plot1e <- ggplot(dfcregionsonly, aes(x = reorder(region, -bookings_count), y = bookings_count)) + \n","            geom_col(fill = \"steelblue\") +\n","            labs(title = \"Number of Bookings by Region in Africa\") +\n","            Theme1\n","\n","Plot2e <- ggplot(dfchotelregions, aes(x = reorder(region, -bookings_count), y = bookings_count, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","Plot3e <- ggplot(dfcregionsonly, aes(x = reorder(region, -average_rate), y = average_rate)) + \n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Region in Africa\") +\n","            Theme1\n","\n","Plot4e <- ggplot(dfchotelregions, aes(x = reorder(region, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#5. Arraging and aligning each plot\n","grid.arrange(Plot1e, Plot3e, ncol = 2)\n","grid.arrange(Plot2e, Plot4e, ncol = 2)"]},{"cell_type":"markdown","id":"3cf0db89","metadata":{"papermill":{"duration":0.227118,"end_time":"2022-03-26T01:00:25.98902","exception":false,"start_time":"2022-03-26T01:00:25.761902","status":"completed"},"tags":[]},"source":["<a id=\"section-4.5\"></a>\n","### 4.5 Booking Volume and Average Nightly Cost in Oceonia ###"]},{"cell_type":"code","execution_count":16,"id":"6ec188f6","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:00:26.462554Z","iopub.status.busy":"2022-03-26T01:00:26.460162Z","iopub.status.idle":"2022-03-26T01:00:27.510394Z","shell.execute_reply":"2022-03-26T01:00:27.509659Z"},"papermill":{"duration":1.292457,"end_time":"2022-03-26T01:00:27.510526","exception":false,"start_time":"2022-03-26T01:00:26.218069","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAAJYCAIAAAB9qzx/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT5R/A8Sej6V4UKHvvLaAiIiLwYyMIiCJD3LJUEBVxgAgiQ0BQFBUBURFk\niCwZykYZMmWvAmWVVbpXcr8/kl5DmtXmkrTN5/1HX9fcc5fn7p5Lnueb555HJUmSAAAAAAAA\nAAAAAAAAAIo6tbczAAAAAAAAAAAAAAAAAHgCHWUAAAAAAAAAAAAAAADgE+goAwAAAAAAAAAA\nAAAAAJ9ARxkAAAAAAAAAAAAAAAD4BDrKAAAAAAAAAAAAAAAAwCfQUQYAAAAAAAAAAAAAAAA+\ngY4yAAAAAAAAAAAAAAAA8Alab2cAAAB4mT41bsv