s, aes(x = reorder(region, -bookings_count), y = bookings_count, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","Plot3f <- ggplot(dfcregionsonly, aes(x = reorder(region, -average_rate), y = average_rate)) + \n","            geom_col(fill = \"steelblue\") +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Average Rate per Night by Region in Oceania\") +\n","            Theme1\n","\n","Plot4f <- ggplot(dfchotelregions, aes(x = reorder(region, -average_rate), y = average_rate, fill = hotel)) +\n","            geom_bar(position = 'dodge', stat = \"identity\") +\n","            scale_fill_manual(values = c(\"City Hotel\" = \"steelblue3\", \"Resort Hotel\" = \"steelblue4\")) +\n","            scale_y_continuous(labels = unit_format(prefix = \"$\", suffix = \"\")) +\n","            labs(title = \"Region Breakdown by City and Resort Hotel\") +\n","            Theme1\n","\n","#5. Arraging and aligning each plot\n","grid.arrange(Plot1f, Plot3f, ncol = 2)\n","grid.arrange(Plot2f, Plot4f, ncol = 2)"]},{"cell_type":"markdown","id":"a588fcc0","metadata":{"papermill":{"duration":0.234051,"end_time":"2022-03-26T01:00:27.981494","exception":false,"start_time":"2022-03-26T01:00:27.747443","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"81f6c4cb","metadata":{"papermill":{"duration":0.248574,"end_time":"2022-03-26T01:00:28.475617","exception":false,"start_time":"2022-03-26T01:00:28.227043","status":"completed"},"tags":[]},"source":["<a id=\"section-5.0\"></a>\n","### 5.0 Booking Dsitributions by Country ###"]},{"cell_type":"code","execution_count":17,"id":"541ed7f1","metadata":{"_kg_hide-input":true,"execution":{"iopub.execu