 1)) %>%\n","    mutate(\"average_rate\" = total_rate / n())\n","\n","#3. Plots\n","MapCity <- highchart() %>%\n","    hc_add_series_map(worldgeojson, dfcCity, value = \"bookings_count\", joinBy = c(\"iso3\", \"country\")) %>%\n","    #hc_colorAxis(minColor = \"#fde725\", maxColor = \"#0d0887\") %>%\n","    hc_legend(align = \"top\", verticalAlign = \"top\", layout = \"horizontal\", x = -8, y = 41) %>%\n","    hc_title(text = \"City Hotel Bookings Volume by Country\", align = \"left\") %>%\n","    hc_subtitle(text = \"Scale in Natural Log\", align = \"left\")\n","\n","MapResort <- highchart() %>%\n","    hc_add_series_map(worldgeojson, dfcResort, value = \"bookings_count\", joinBy = c(\"iso3\", \"country\")) %>%\n","    hc_legend(align = \"top\", verticalAlign = \"top\", layout = \"horizontal\", x = -8, y = 41) %>%\n","    hc_title(text = \"Resort Hotel Bookings Volume by Country\", align = \"left\") %>%\n","    hc_subtitle(text = \"Scale in Natural Log\", align = \"left\")\n","\n","#4. Arraging and aligning each plot\n","hw_grid(MapCity, MapResort)"]},{"cell_type":"markdown","id":"66189e64","metadata":{"papermill":{"duration":0.284233,"end_time":"2022-03-26T01:00:36.793438","exception":false,"start_time":"2022-03-26T01:00:36.509205","status":"completed"},"tags":[]},"source":["City hotel bookings appears to have a higher concentration around the europe region followed by USA, Brazil and China. Also, it looks like there's more countries with City Hotels vs Resort Hotels."]},{"cell_type":"markdown","id":"7889fe58","metadata":{"papermill":{"duration":0.286017,"end_time":"2022-03-26T01:00:37.36566","exception":false,"start_time":"2022-03-26T01:00:37.079643","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"4531e9fb","metadata":{"papermill":{"duration":0.287336,"end_time":"2022-03-26T01:00:37.940739","exception":false,"start_time":"2022-03-26T01:00:37.653403","status":"completed"},"tags":[]},"source":["<a id=\"section-6.0\"></a>\n","### 6.0