le = element_blank(),\n","                    plot.title = element_text(size = 24),\n","                    axis.title = element_blank(),\n","                    axis.text.x = element_text(size = 15),\n","                    axis.text.y = element_text(size = 15),\n","                    legend.text = element_text(size = 15),\n","                    legend.spacing.x = unit(4, 'mm'),\n","                    legend.justification = 'left')\n","\n","#2. Overall trend by hotel type\n","dfc %>%\n","    mutate(kids = (children + babies), with_kids = ifelse(kids >= 1, \"With Kids\", \"Without Kids\")) %>%\n","    group_by(arrival_month_year, hotel) %>%\n","    summarize(\"bookings_count\" = n()) %>%\n","    ggplot(aes(x = arrival_month_year, y = bookings_count, fill = hotel)) +\n","        geom_area(colour = \"black\", size = .2, alpha = .4) +\n","        scale_fill_manual(values = c(\"City Hotel\" = \"steelblue2\", \"Resort Hotel\" = \"steelblue4\")) +\n","        scale_x_date(breaks = dfc$arrival_month_year, date_labels = \"%b-%y\") +\n","        scale_y_continuous(labels = unit_format(suffix = \"K\", scale = 0.001)) +\n","        labs(title = \"Monthly Booking Trends by Hotel Type\") +\n","        Theme2\n","\n","#3. Trend by guests with no kids\n","dfc %>%\n","    mutate(kids = (children + babies), with_kids = ifelse(kids >= 1, \"With Kids\", \"Without Kids\")) %>%\n","    filter(., with_kids == \"Without Kids\") %>%\n","    group_by(arrival_month_year, hotel) %>%\n","    summarize(\"bookings_count\" = n()) %>%\n","    ggplot(aes(x = arrival_month_year, y = bookings_count, fill = hotel)) +\n","        geom_area(colour = \"black\", size = .2, alpha = .4) +\n","        scale_fill_manual(values = c(\"City Hotel\" = \"steelblue2\", \"Resort Hotel\" = \"steelblue4\")) +\n","        scale_x_date(breaks = dfc$arrival_month_year, date_labels = \"%b-%y\") +\n","        scale_y_continuous(labels = unit_format(suffix = \"K\", scale = 0.001)) +\n","        labs(title = \"Bookings Trend by Hotel Type and Adult Guests Only\") +\n","        Theme2 +\n","        theme(legend.position=\"none\")\n","\n","#4. Trend by guests with kids only\n","dfc %>%\n","    mutate(kids = (children + babies), with_kids = ifelse(kids >= 1, \"With Kids\", \"Without Kids\")) %>%\n","    filter(., with_kids != \"Without Kids\") %>%\n","    group_by(arrival_month_year, hotel) %>%\n","    summarize(\"bookings_count\" = n()) %>%\n","    ggplot(aes(x = arrival_month_year, y = bookings_count, fill = hotel)) +\n","        geom_area(colour = \"black\", size = .2, alpha = .4) +\n","        scale_fill_manual(values = c(\"City Hotel\" = \"steelblue2\", \"Resort Hotel\" = \"steelblue4\")) +\n","        scale_x_date(breaks = dfc$arrival_month_year, date_labels = \"%b-%y\") +\n","        scale_y_continuous(labels = unit_format(suffix = \"K\", scale = 0.01)) +\n","        labs(title = \"Bookings Trend by Hotel Type and Guests with Kids Only\") +\n","        Theme2 +\n","        theme(legend.position=\"none\")"]},{"cell_type":"markdown","id":"ca059b17","metadata":{"papermill":{"duration":0.310439,"end_time":"2022-03-26T01:02:46.182685","exception":false,"start_time":"2022-03-26T01:02:45.872246","status":"completed"},"tags":[]},"source":["It seems like, overall city hotel bookings peak around May - Jun and Oct - Sep. Resort hotel bookings seems to be pretty consistent throughout but follows the overall trend for guests without children.\n","\n","Guests with kids on the other hand appears to have bookings more concentrated around the Jul - Aug periods, most likely due to summer holidays in the northern hemisphere and driven by the concentration of observations from Europe. This could be especially useful in scenarios where companies are planning targeted marketing events. The one anomaly I need to call out if Jul 2015 - Aug 2015 which appears to have much lesser bookings compared to the same periods for year 2016 and 2017.\n","\n","Next, I'm curios to see how customers tend to manage their bookings, lead time distribution and cancellation profiles."]},{"cell_type":"markdown","id":"9e5b6e1e","metadata":{"papermill":{"duration":0.299015,"end_time":"2022-03-26T01:02:46.779894","exception":false,"start_time":"2022-03-26T01:02:46.480879","status":"completed"},"tags":[]},"source":["\n","***"]},{"cell_type":"markdown","id":"2612957b","metadata":{"papermill":{"duration":0.302532,"end_time":"2022-03-26T01:02:47.38208","exception":false,"start_time":"2022-03-26T01:02:47.079548","status":"completed"},"tags":[]},"source":["<a id=\"section-7.0\"></a>\n","### 7.0 Market Segmentations ###"]},{"cell_type":"code","execution_count":19,"id":"a02c953a","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-26T01:02:47.992767Z","iopub.status.busy":"2022-03-26T01:02:47.991025Z","iopub.status.idle":"2022-03-26T01:02:48.493833Z","shell.execute_reply":"2022-03-26T01:02:48.492343Z"},"papermill":{"duration":0.810842,"end_time":"2022-03-26T01:02:48.493985","exception":false,"start_time":"2022-03-26T01:02:47.683143","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAAJYCAIAAAB9qzx/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AU1RbA8bs1vQcCoXcIHaSKdOlNQJQugoACPkGUonSUHkCkCYiAoHREehAB\nBem9dwg1QEgv2+Z92GQJye5mk2xIQv6/T3dn7tw5s3Nn3gt7vEcmSZIAAAAAAAAAAAAAAAAA\n3nTyrA4AAAAAAAAAAAAAAAAAeB1IlAEAAAAAAAAAAAAAAECuQKIMAAAAAAAAAAAAAAAAcgUS\nZQAAAAAAAAAAAAAAAJArkCgDAAAAAAAAAAAAAACAXIFEGQAAAAAAAAAAAAAAAOQKJMoAAAAA\nAAAAAAAAAAAgV1BmdQAAkH0Fn9z52x97/zty5Pz14BcvQsOjtc4urp55C5QtG1CnQdNWHd6v\nVcIjq2MEAAAAAAAAAAAAANjqTVhR5pP8brLUKB2cff38y9ds3O+LMTtO3s/qkG2yraqfMXif\nMsvTeuzzy51M134nXp8Z4WVzPf1cjZcf8Ol/WR2LRd4qRdJZ+u7vN9M6woHeZZKO4Jb/k8yI\n00YZmbHZ0JPja9vXLl74rVYjJgVuCTp8805waHi0XqeJDA8Nvn4+6M+1E4d/UqeUb632g/+7\nH53VwQIAAAAAAAAAAAAAbPImJMrYQq+JfR7y6NLxv5fNndz6rUKV2g+/GqXN6qCAV5wYszqN\nRxhGbbmbKaHken9P61GkdtetR29b7yZJumNb579TouT0XXdeS1wAAAAAAAAAAAAAgAzJpaWX\nzm+dVa3U2SM3dlR0UWV1LECC8FuTT0WNquZq65yMvDfzv4j4TA0pdzq/qHfjkS+Tlhx9ynzY\nu