reserved) %>%\n","    summarize(bookings_count = n()) %>%\n","    mutate(Percent = round(bookings_count / sum(bookings_count), 3)) %>%\n","    ggplot(aes(x = \"\", y = bookings_count, fill = assigned_as_reserved)) +\n","    geom_bar(width = 1, stat = \"identity\") +\n","    coord_polar(\"y\", start=0) +\n","    geom_text(aes(label = paste0(Percent*100, \"%\")), position = position_stack(vjust=.5), size = 7)  +\n","    labs(title = \"City Hotels\") +\n","    theme_minimal() +\n","    ThemePie +\n","    scale_fill_brewer(palette = \"Greens\")\n","\n","#2. Plot 3 by Resort Hotels\n","Resort.Assign <- dfc.room.assign %>%\n","    filter(hotel == \"Resort Hotel\") %>%\n","    group_by(assigned_as_reserved) %>%\n","    summarize(bookings_count = n()) %>%\n","    mutate(Percent = round(bookings_count / sum(bookings_count), 3)) %>%\n","    ggplot(aes(x = \"\", y = bookings_count, fill = assigned_as_reserved)) +\n","    geom_bar(width = 1, stat = \"identity\") +\n","    coord_polar(\"y\", start=0) +\n","    geom_text(aes(label = paste0(Percent*100, \"%\")), position = position_stack(vjust=.5), size = 7)  +\n","    labs(title = \"Resort Hotels\") +\n","    theme_minimal() +\n","    ThemePie +\n","    scale_fill_brewer(palette = \"Greens\")\n","\n","#6. Arrange plots by grid\n","grid.arrange(Total.Assign, City.Assign, Resort.Assign, ncol = 3)"]},{"cell_type":"markdown","id":"23e20aa3","metadata":{"papermill":{"duration":0.31872,"end_time":"2022-03-26T01:03:00.70086","exception":false,"start_time":"2022-03-26T01:03:00.38214","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"4c593879","metadata":{"papermill":{"duration":0.320706,"end_time":"2022-03-26T01:03:01.339601","exception":false,"start_time":"2022-03-26T01:03:01.018895","status":"completed"},"tags":[]},"source":["<a id=\"section-11.0\"></a>\n","### 11.0 Summary ###  \n","Key observations include:\n","1. Largest bookings occur in Europe\n","2. Highest nightly rate is observed in Africa\n","3. Trend seems to suggest that bookings ramps up around May - Jun and Oct - Sep\n","4. Trend for guests with kids appears to have concentrations around Jul - Aug (likely due to summer holidays)\n","5. Lead time distributions similarly distributed with a peak around the 10 days mark\n","6. On average guests with kids is observed to have shorter lead times by about 20 days\n","7. Approximately 37% of bookings get canceled\n","8. Transient customers have the highest % of cancelations at 40.9%\n","9. Approximately 12% of guests do not get the rooms they reserve with resort hotel observing over 19% vs city at 9%"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":197.957854,"end_time":"2022-03-26T01:03:01.871251","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-26T00:59:43.913397","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}